webpackJsonp([0x803e8946a9ab],{502:function(A,e){A.exports={data:{site:{siteMetadata:{title:"ourbucketl.ist",author:"Dan Rose & Sophie Mellissa"}},markdownRemark:{id:"C:/Users/danja/OneDrive/Documents/GitHub/ourbucketl.ist/src/pages/santa-marta/index.md absPath of file >>> MarkdownRemark",html:'<blockquote>\n<p>“One’s destination is never a place, but always a new way of seeing things.”</p>\n</blockquote>\n<p>Henry Miller.</p>\n<h2>Santa Marta</h2>\n<p>After the pleasant surprise of Cartagena, Santa Marta was a bit of a let down. We were warned that many Venezuelan refugees had fled to Santa Marta and we’d been told to watch out at ATMs. Apart from a Cathedral, a library dedicated to Gabriel Garcia Marquez and a street full of bars and restaurants there was nothing else to really see in the oldest city in Colombia. It seemed that mainly Colombian tourists visited the resort of Rodereo and backpackers used Santa Marta as a hub to neighbouring attractions, luckily we didn’t hang around for long.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/cathedral-0bf03fd2cde26a185791501a36b6e03d-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Cathedral"\n        title="Cathedral"\n        src="/static/cathedral-0bf03fd2cde26a185791501a36b6e03d-769ec.jpg"\n        srcset="/static/cathedral-0bf03fd2cde26a185791501a36b6e03d-d9ef2.jpg 225w,\n/static/cathedral-0bf03fd2cde26a185791501a36b6e03d-ac97c.jpg 450w,\n/static/cathedral-0bf03fd2cde26a185791501a36b6e03d-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>Tayrona National Park</h2>\n<p>We decided to visit the <a href="https://wikitravel.org/en/Tayrona_National_Park">National Park</a> for one night rather than two as accommodation options were limited. We could either camp in a boiling hot tent or sleep in a hammock where mosquitoes would have free reign, so we went with the tent. We got a bus from Santa Marta for $7000COP (£1.77) to the entrance of the park, paid the $54,000COP (£13.64) entrance fee to get in and hiked the hour and a half in the boiling heat to get to the campsite we’d picked. Within minutes we were dripping with sweat, Tayrona National Park was one of the hottest places we’d been, even more so than the Amazon rainforest.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/jungle-719108d8c14feb33652956375c760fe7-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Jungle"\n        title="Jungle"\n        src="/static/jungle-719108d8c14feb33652956375c760fe7-769ec.jpg"\n        srcset="/static/jungle-719108d8c14feb33652956375c760fe7-d9ef2.jpg 225w,\n/static/jungle-719108d8c14feb33652956375c760fe7-ac97c.jpg 450w,\n/static/jungle-719108d8c14feb33652956375c760fe7-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>After dropping off our bags we headed to San Juan beach. It wasn’t as big as we thought it would be but there was white sand and blue sea. As we tried to find a place under the palms in the shade we saw an iguana running across the beach and noticed a swampy lake with warnings that there are caiman living there.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/iguana-8b254f3ce0c32fb2629b415cbe4cb17a-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="San Juan Beach"\n        title="San Juan Beach"\n        src="/static/iguana-8b254f3ce0c32fb2629b415cbe4cb17a-769ec.jpg"\n        srcset="/static/iguana-8b254f3ce0c32fb2629b415cbe4cb17a-d9ef2.jpg 225w,\n/static/iguana-8b254f3ce0c32fb2629b415cbe4cb17a-ac97c.jpg 450w,\n/static/iguana-8b254f3ce0c32fb2629b415cbe4cb17a-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>We had wanted to hike to El Pueblito, an indigenous village where people from the Kogi tribe live, especially as we weren’t going to do the Los City Trek. It’s around a two hour hike from San Juan, but by the time we’d got there from our campsite we were wiped and decided to nap in the shade instead.</p>\n<p>The campsite we stayed in was really basic, tents with a foam mattress, showers with a hose pipe, no WiFi and toilets with no toilet seat. We had an early night knowing the heat would wake up us the next morning. Around 5:00AM we woke up to the sound of howler monkeys in the forest nearby. After they left we managed to get another couple of hours sleep in before the sun got too hot and we had to evacuate the tents.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/campsite-3583efd262e1fbf8ecd5e8461e24cc5d-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Campsite"\n        title="Campsite"\n        src="/static/campsite-3583efd262e1fbf8ecd5e8461e24cc5d-769ec.jpg"\n        srcset="/static/campsite-3583efd262e1fbf8ecd5e8461e24cc5d-d9ef2.jpg 225w,\n/static/campsite-3583efd262e1fbf8ecd5e8461e24cc5d-ac97c.jpg 450w,\n/static/campsite-3583efd262e1fbf8ecd5e8461e24cc5d-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>We’d decided to go back to the closest beach for the morning before the hike back and the sweaty bus back to Santa Marta. However, on our way we saw some cotton-top tamarin monkeys. They completely surrounded us squeaking and jumping from tree to tree. The brave ones stuck around and checking us out by peering around the tree trunks. After this we continued on what we thought was the way to the beach but we’d took a wrong turn and ended up walking an hour in the wrong direction to the exit. We stayed for breakfast and then hiked 2.5 hours back to the bus stop, absolutely drenched in sweat!</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/monkeys-3c9147271911f54def6e1bfb52f078d6-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Cotton-top tamarin monkeys"\n        title="Cotton-top tamarin monkeys"\n        src="/static/monkeys-3c9147271911f54def6e1bfb52f078d6-769ec.jpg"\n        srcset="/static/monkeys-3c9147271911f54def6e1bfb52f078d6-d9ef2.jpg 225w,\n/static/monkeys-3c9147271911f54def6e1bfb52f078d6-ac97c.jpg 450w,\n/static/monkeys-3c9147271911f54def6e1bfb52f078d6-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>Palomino</h2>\n<p>Palomino is only two hours from Santa Marta so we decided to spend one night in the little village in the hunt of some more beach time. When we arrived it was literally shacks and dirt roads with lots of hostels (and hippies). We spent the rest of the day by the pool with the plan of hitting the beach the next day. Palomino beach had a few bars and hotels but it went on for miles and miles and was much more secluded than we thought it would be. We had a stroll along it in the morning but it was sadly, a little disappointing. The sea was also so rough, that it wasn’t possible to take a dip, so as we were melting from the heat, we headed back to the hostel to use the pool.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/palomino-9a980bb9aa365d018a98db328d040b1d-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Palomino Beach"\n        title="Palomino Beach"\n        src="/static/palomino-9a980bb9aa365d018a98db328d040b1d-769ec.jpg"\n        srcset="/static/palomino-9a980bb9aa365d018a98db328d040b1d-d9ef2.jpg 225w,\n/static/palomino-9a980bb9aa365d018a98db328d040b1d-ac97c.jpg 450w,\n/static/palomino-9a980bb9aa365d018a98db328d040b1d-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>The Dreamer</h2>\n<p>We booked two nights at <a href="http://www.thedreamerhostel.com/en/">The Dreamer</a>, a hostel just outside of town in Santa Marta, as we felt we needed some time to chill out in one place. The hostel had a pool, a restaurant, TV’s with the World Cup on and we had a pool volleyball competition. One of the nights we were there we finally had a Salsa lesson; we struggled to master even the basics but luckily Dan didn’t tread on my toes!</p>\n<h2>Our verdict on Santa Marta &#x26; Palomino</h2>\n<p>After spending some time in the beautiful city of Cartagena, Santa Marta and Palomino really didn’t compare. However, we loved Tayrona National Park and if it wasn’t for sleeping in a sweaty tent we would definitely have spent more time there!</p>',frontmatter:{title:"Santa Marta & Palomino, Colombia",date:"June 15, 2018",image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5,src:"/static/san-juan-e3d9278a416968ef703c5fa040ba5a4e-3f77d.jpg",srcSet:"/static/san-juan-e3d9278a416968ef703c5fa040ba5a4e-f4b72.jpg 480w,\n/static/san-juan-e3d9278a416968ef703c5fa040ba5a4e-94546.jpg 960w,\n/static/san-juan-e3d9278a416968ef703c5fa040ba5a4e-3f77d.jpg 1620w",sizes:"(max-width: 1620px) 100vw, 1620px"}}}}}},pathContext:{slug:"/santa-marta/",previous:{fields:{slug:"/cartagena/"},frontmatter:{title:"Cartagena, Colombia"}},next:{fields:{slug:"/san-andres-island/"},frontmatter:{title:"San Andrés Island, Colombia"}}}}}});
//# sourceMappingURL=path---santa-marta-8c8996ded75ddf56a04b.js.map